import React from "react";

function SearchInput({ children }) {
  return (
    <div
      style={{ height: 150, clear: "both", paddingTop: 20, paddingLeft: 20, paddingRight:20}}
      className="search-input"
    >
      <h3> Book Search</h3>
      <h6> Book</h6>
      <input type="text" className="text" placeholder="Search for a book" />
      <button type="submit btn-primary" className="search-button" style={{ addingRight:20}}>Search</button>
    </div>
  );
}

export default SearchInput;
